import { Component, OnInit } from '@angular/core';
import { CORE_DIRECTIVES } from '@angular/common';
import { StudentGroupMarkService } from '../../+student-groups/shared';
const pdfMake = require('pdfmake-browserified');
@Component({
  moduleId: module.id,
  selector: 'app-student-management',
  templateUrl: 'report-cards.component.html',
  providers: [StudentGroupMarkService],
  directives: [CORE_DIRECTIVES]
})
export class ReportCardsComponent implements OnInit {
  reportCards: any[];
  constructor(private studentGroupMarkService: StudentGroupMarkService) {
  }

  ngOnInit() {
    this.studentGroupMarkService.getReportCards().subscribe(reportCards => {
      this.reportCards = reportCards;
    });
  }
  renderReportCards() {
    let image = 'data:image/png;base64,';
    let reportCard = [];
    for (let studentMark of this.reportCards) {
      let columns = [{ text: 'Subject', style: 'tableHeader' }];
      let tableRow = [];
      let widths = ['30%'];
      for (let column of studentMark.columns) {
        widths.push('*');
        columns.push({ text: column, style: 'tableHeader' });
      }
      tableRow.push(columns);
      for (let row of studentMark.rows) {
        let dataRow = [{ text: row.header }];
        for (let d of row.data) {
          let marks = null;
          if (d) {
            marks = d.marks;
          } else {
            marks = '_';
          }
          dataRow.push({ text: marks });
        }
        tableRow.push(dataRow);
      }
      let totalsRow = [{ text: 'Total', style: 'tableHeader' }];
      for (let row of studentMark.column_totals) {
        totalsRow.push({ text: row, style: 'tableHeader' });
      }
      tableRow.push(totalsRow);
      let content = {
        stack: [
          {
            image: image,
            fit: [100, 100],
            style: 'center'
          },
          {
            alignment: 'justify',
            columns: [
              { text: 'Name: ' + studentMark.full_name },
              { text: 'Term: ' },
              { text: 'Year: ' }
            ]
          },
          {
            style: 'tableExample',
            table: {
              widths: widths,
              headerRows: 1,
              body: tableRow
            }
          }
        ],
        pageBreak: 'after'
      }
      reportCard.push(content);
    }
    reportCard[reportCard.length - 1].pageBreak = '';
    let content = {
      content: reportCard,
      styles: {
        header: {
          fontSize: 18,
          bold: true,
          margin: [0, 0, 0, 10]
        },
        subheader: {
          fontSize: 16,
          bold: true,
          margin: [0, 10, 0, 5]
        },
        tableExample: {
          margin: [0, 5, 0, 15]
        },
        tableHeader: {
          bold: true,
          fontSize: 13,
          color: 'black'
        },
        center:
        {
          alignment: 'center'
        }
      }
    }
    pdfMake(content).open();
  }
}
